Gently used (little holster wear) Walther P22; 
   - .22LR; 
   - 3.4" barrel;
   - Made in Germany;
   - DA/SA with thumb safety;
   - Adjustable rear sight. Additional various heights of front sights included;
   - 2 sizes of back straps;
   - Hard case and two 10 rd. mags and all the tools, accessories, and papers that   
     originally came with the gun.

$300.00 OBO. Gun will be transferred through a licensed dealer at buyer's cost (non-negotiable).
